import Table from "react-bootstrap/Table";
const CTable = (props) => {
  const Header = props.header.map((th, i) => {
    return <th key={i}>{th}</th>;
  });
  return (
    <>
      <Table>
        <thead>
          <tr>{Header}</tr>
        </thead>
        <tbody>
          <tr></tr>
        </tbody>
      </Table>
    </>
  );
};
export default CTable;
